import { ModelAnalyticsEvent } from './model-analytics-event';
export class ModelMetaClickEvent extends ModelAnalyticsEvent {
    constructor(analyticsSetup, modelRangeName, modelMeta) {
        super(analyticsSetup, modelRangeName);
        this.context.eventAction = 'PAGHomeNav_ModelMetaFunction_Click';
        this.populateComponentClickFromLink(modelMeta);
    }
    populateComponentClickFromLink(modelMeta) {
        this.componentClick.clickElementId = modelMeta.PhraseId;
        this.componentClick.clickElementName = modelMeta.Text;
        this.componentClick.clickElementType = 'link';
        this.componentClick.targetUrl = modelMeta.Link;
    }
    event() {
        const componentClick = this.componentClick;
        return Object.assign(Object.assign({}, super.event()), { componentClick });
    }
}
